import React, { Component } from "react";

class Heart extends Component {
	render() {
		console.log("props", this.props);
		return (
			<div>
				<button onClick={() => this.props.onClick()}>
					<i className='fa fa-heart m-2' aria-hidden='true'></i>
				</button>
			</div>
		);
	}
}

export default Heart;
